import React from "react";
import PaginationContent from "../layout/PaginationContent";
import CardContent from "./CardContent";
import Container from "react-bootstrap/Container";

function News() {
  return (
    <div>
      <h2>News</h2>
      <Container>
        <PaginationContent />
        <CardContent />
      </Container>
    </div>
  );
}

export default News;
